// Get prospect data
const prospect = $('Get Prospect').item.json;

// Use prospect data
const has_competitor = !(prospect.apps && prospect.apps.length > 1) ? false :
  prospect.apps.includes('leadinfo') ? 'leadinfo' :
  prospect.apps.includes('clearbit') ? 'clearbit' : false;

// Prepare tags for updating
const tags = prospect.tags.length > 0 ? prospect.tags.split('|') : [];

// Qualify by LLM data
if(!!$json.output.is_b2b) {
    // All B2B companies fit ICP
    prospect.label = 1;

  // Segment B2B companies that fit ICP
  if(!!$json.output.is_saas || !!$json.output.is_crm_expert) {
    tags.push('Potential API');
  } else if (has_competitor) {
    tags.push('Potential ProspectPro');
  } else {
    tags.push('Potential Dataset');
  }
} else {
  // Other companies are disqualified
  prospect.label = 0;
}

// IMPORTANT: confirm prospect has been processed by this workflow by adding a tag
tags.push("AutoQualified");

return {
    ...prospect,
  tags
};

